import React from 'react'
import './regions.css';
export default function Regions() {
  return (
    <div className='regionscontainer'>
      <h3>Regions:</h3>
      <select>
        <option>Northern</option>
        <option>Malakand</option>
        <option>WaterShed</option>
        <option>Kohat </option>
        <option>DI khan</option>
      </select>
    </div>
  )
}
